column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
વપરાશ: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

બધી રેડિયો સ્વીચની પરિસ્થિતિ મેળવો, અથવા તેમને ચાલુ/બંધ કરો.

